$(document).ready(function(){$("[data-bs-hover-animate]").mouseenter(function(){var t=$(this);t.addClass("animated "+t.attr("data-bs-hover-animate"))}).mouseleave(function(){var t=$(this);t.removeClass("animated "+t.attr("data-bs-hover-animate"))})}),$("#menu-toggle").click(function(t){t.preventDefault(),$("#wrapper").toggleClass("toggled")}),$(function(){new Swiper(".swiper-container",{loop:!0,pagination:".swiper-pagination",paginationClickable:!0,nextButton:".swiper-button-next",prevButton:".swiper-button-prev"})});